import React, { Component } from 'react';
import './App.css';
import Cards from './Cards';

class App extends Component {
  constructor(){
    super()
    this.state = {
      firstname: "Andres",
      lastname: "Ochoa"
    }
  }
  render(){
    return(
      <div>
        <h1>{this.state.firstname}</h1> 
        <h1>{this.state.lastname}</h1>               
      </div>
    )
  } 
}

export default App;
